import React from 'react';

function ListView({ data }) {
  return (
    <div className="list-view">
      {data.map((item) => (
        <div key={item.id} className="list-item">
          <h3>{item.name}</h3>
          <p>{item.description}</p>
          {/* Add more fields as needed */}
        </div>
      ))}
    </div>
  );
}

export default ListView;
